import React from 'react';
import './App.css';
//import 'bootstrap/dist/css/bootstrap.min.css';
import {
  MainNavbar,
  MainJumbotron,
  About,
  Recruiting,
  Team,
} from './components/componentIndex.jsx'

function App() {

  const fetch_data = async () => {
    const response = await fetch('localhost:1337/recruiters');
    const data = await response.json();
    console.log(data);
  }

  return (
    <div className="App">
      <MainNavbar />
      <MainJumbotron />
      <About />
      <Team />
      <Recruiting />
    </div>
  );
}

export default App;
